ALWAYS. BELIEVE.
@fabiojakobsen, so so many people are proud of you today. Those days you were in pain, those days you were scared, those days you were hurting and suffering, those days when you just didn’t know. How you pushed through them, those were the days that brought you back. Not just brought you back to the same level, but to a higher level. All because you kept that belief and you worked hard. And fuck, did you work hard! So privileged to have witnessed it. Another Grand Tour stage win @lavuelta. So proud of you dude. Congratulations 👏👏👏

📸 @gettysport
